import React, { useEffect, useState } from "react";

//https://jsonplaceholder.typicode.com/posts

function Map(){

    const[data,setData]=useState(null)

    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/todos")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
    })
    return(
        <div>
            <h2>Fetch Data from server</h2>
            <table>
                <thead>
                    <th>userID</th>
                    <th>id</th>
                    <th>title</th>
                    <th>body</th>
                </thead>
                <tbody>
                    {
                     data.Map((item)=>(
                        <tr>
                        <td>{item.userId}</td>
                        <td>{item.id}</td>
                        <td>{item.title}</td>
                        <td>{item.body}</td>
                        </tr>
                    ))  }


                </tbody>
            </table>
        </div>
    )
}

export default Map;
